import Cards from '../UI/Cards'
import './Cart.css'
import Modal from '../UI/Modal'


function Cart(props){

    const cartitems=[
        {
            id:'c1',
            name:'Sushi',
            amount:'2',
            price:'12.99'
        },
        {
            id:'c2',
            name:'oomph',
            amount:'3',
            price:'162.91'
        }
    ]

    return(

        <Modal>
            <ul className='cart-items'>
                {cartitems.map(items=>
                    <li>
                        {items.name}
                    </li>    
                )}
            </ul>

            <div className='total'>
                <span>Total Amount</span>
                <span>1231.11</span>
            </div>

            <div className='actions'>

                <span><button className='button--alt'>Close</button></span>
                <span></span><button className='button'>Order</button>
                
            </div>
        </Modal>
    )
}

export default Cart
